# Function to compute features
def compute_features(p1, p2, r1, r2, o1, o2):
    clay1 = clay_win_pct[p1]
    clay2 = clay_win_pct[p2]
    clay_diff = clay1 - clay2
    h2h_diff = h2h_wins[p1][p2] - h2h_wins[p2][p1]
    rank_diff = r1 - r2
    odds_diff = o2 - o1

    return pd.DataFrame([{
        'Clay_Win_%_P1': clay1,
        'Clay_Win_%_P2': clay2,
        'Clay_Win_%_Diff': clay_diff,
        'H2H_Diff': h2h_diff,
        'Rank_Diff': rank_diff,
        'Odds_Diff': odds_diff
    }])

